            users:[]
        }
    }

    componentDidMount(){
        userService().then((response)=>{
             this.setState = response.data;
        })
    }

    render(){
        return (
            
            <div className='user'>

            <thead>
                 <tr>
                    <td>
                        email_id
                    </td>
                    <td>
                        password
                    </td>
                 </tr>
            </thead>

            <tbody>
                {
                    this.state.users.map(
                        user => 
                            <tr key={user.email_id}>
                              <td>
                                    {user.email_id}
                              </td>
                              <td>
                                    {user.password}
                              </td>
                            </tr>
                    )
                }
            </tbody>
            
        </div>

        )
    }
    render(){
        return <div>
            HELLO
        </div>
    }
}
*/

